    constructor(){
        super()
        this.state = {
            like : 0
        }
    }

    render(){
        return (
            <div>
            <Button as='div' labelPosition='right' style={{marginLeft:"400px"}}>
            <Button color='red' content="Like">
              <Icon name='heart' />
              Like
            </Button>
            <Label as='a' basic color='red' pointing='left'>
              2,048
            </Label>
            </Button>
            </div>
        )
    }
}

export default Buttons
